import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { useState, useEffect } from 'react';
import Navigation from './components/Navigation';
import MyExhibits from './pages/MyExhibits';

function Home() {
  const [artworks, setArtworks] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchArtworks = async () => {
      try {
        // Fetch artworks from the Art Institute of Chicago API
        // Using search endpoint to get popular public domain artworks
        const response = await fetch(
          'https://api.artic.edu/api/v1/artworks/search?query[term][is_public_domain]=true&limit=15&fields=id,title,artist_display,date_display,image_id,style_titles,classification_titles'
        );

        if (!response.ok) {
          throw new Error('Failed to fetch artworks');
        }

        const data = await response.json();

        // Process the data to match our component structure
        const processedArtworks = data.data
          .filter(artwork => artwork.image_id) // Only include artworks with images
          .map(artwork => ({
            id: artwork.id,
            title: artwork.title || 'Untitled',
            artist: artwork.artist_display ? artwork.artist_display.split('\n')[0] : 'Unknown Artist', // Take first line of artist display
            year: artwork.date_display || 'Unknown Date',
            image_id: artwork.image_id,
            tags: [
              ...(artwork.style_titles ? artwork.style_titles.slice(0, 1) : []),
              ...(artwork.classification_titles ? artwork.classification_titles.slice(0, 1) : [])
            ].filter(Boolean).slice(0, 2) // Limit to 2 tags and filter out empty values
          }));

        setArtworks(processedArtworks.slice(0, 15)); // Ensure we have exactly 15 artworks
      } catch (err) {
        console.error('API Error:', err);
        // Fallback to sample data if API fails
        setArtworks([
          { id: 1, title: "Title of Artwork", artist: "First Last", year: "XXXX", tags: ["PERIOD", "POPULAR"], image_id: null },
          { id: 2, title: "Title of Artwork", artist: "First Last", year: "XXXX", tags: ["PERIOD", "POPULAR"], image_id: null },
          { id: 3, title: "Title of Artwork", artist: "First Last", year: "XXXX", tags: ["PERIOD", "POPULAR"], image_id: null }
        ]);
      } finally {
        setLoading(false);
      }
    };

    fetchArtworks();
  }, []);

  // Function to construct IIIF image URL
  const getImageUrl = (imageId) => {
    if (!imageId) return null;
    return `https://www.artic.edu/iiif/2/${imageId}/full/843,/0/default.jpg`;
  };

  if (loading) {
    return (
      <div className="App">
        <Navigation currentPage="home" />
        <main className="gallery">
          <div style={{ textAlign: 'center', padding: '2rem', gridColumn: '1 / -1' }}>
            Loading artworks...
          </div>
        </main>
      </div>
    );
  }

  return (
    <div className="App">
      <Navigation currentPage="home" />

      <main className="gallery">
        {artworks.map((artwork) => (
          <div key={artwork.id} className="artwork-card">
            <div className="artwork-image">
              {artwork.image_id ? (
                <img 
                  src={getImageUrl(artwork.image_id)} 
                  alt={artwork.title}
                  onError={(e) => {
                    e.target.style.display = 'none';
                  }}
                />
              ) : (
                <div className="no-image">No Image Available</div>
              )}
              <button className="bookmark-btn">+</button>
            </div>
            <div className="artwork-info">
              <h3 className="artwork-title">{artwork.title}</h3>
              <p className="artwork-meta">{artwork.artist} â€¢ {artwork.year}</p>
              <div className="artwork-tags">
                {artwork.tags.map((tag, index) => (
                  <span key={index} className={`tag ${tag.toLowerCase().replace(/\s+/g, '-')}`}>
                    {tag.toUpperCase()}
                  </span>
                ))}
              </div>
            </div>
          </div>
        ))}
      </main>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/my-exhibits" element={<MyExhibits />} />
      </Routes>
    </Router>
  );
}

export default App;
